import React from "react";
import { Header, Carousel } from "../components/mollecules";
import { Button, Cards, Text } from "../components/atomes";
import { Discover } from "../components/organismes";

const produitVinRouge = require("../")

function Home() {
  return (
    <div>
      <Header.laptopHeader />
      <Carousel.Carousel />
      <Discover.Discover />
      <div className=" mt-52 mb-52 ml-24">
        <Cards.Produit
          bg={produitVinRouge}
          color={"#5C221E"}
          name={"Vin Rouge"}
        />
      </div>
    </div>
  );
}

export default Home;
